(6, 1, 'لماذا اخترتنا', '<p style=\"box-sizing: inherit; margin: 0px 0px 28px; padding: 0px; color: #333333; font-family: \'Source Sans Pro\', sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-weight: bold;\">Attention to Details</span><br style=\"box-sizing: inherit;\" />It&rsquo;s our attention to the small stuff, scheduling of timelines and keen project management that makes us stand out from the rest. We are creative, while keeping a close eye on the calendar and your budget.</p>\r\n<p style=\"box-sizing: inherit; margin: 0px 0px 28px; padding: 0px; color: #333333; font-family: \'Source Sans Pro\', sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-weight: bold;\">A Plan for Success</span><br style=\"box-sizing: inherit;\" />You want results. We have found that the best way to get them is with up front research &ndash; of your company, competitors, target market and customer psychographics. Only after we fully understand you and your customers, do we recommend a plan of attack.</p>\r\n<p style=\"box-sizing: inherit; margin: 0px 0px 28px; padding: 0px; color: #333333; font-family: \'Source Sans Pro\', sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-weight: bold;\">Creativity</span><br style=\"box-sizing: inherit;\" />We bring our diverse background of advertising, design, branding, public relations, research and strategic planning to work for your company. Not only will your materials look great &ndash; they will get results.</p>\r\n<p style=\"box-sizing: inherit; margin: 0px 0px 28px; padding: 0px; color: #333333; font-family: \'Source Sans Pro\', sans-serif; font-size: 16px;\">Yes, we have won awards for our work. But we don&rsquo;t create concepts in a vacuum &ndash; they fit into the standards of your industry. And once we have a total picture of your company, its target audience and goals, we&rsquo;ll create a detailed plan &ndash; that also includes a commitment to stay on budget and on deadline.</p>\r\n<p style=\"box-sizing: inherit; margin: 0px 0px 28px; padding: 0px; color: #333333; font-family: \'Source Sans Pro\', sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-weight: bold;\">Experts Only</span><br style=\"box-sizing: inherit;\" />First Impressions is comprised of specialists with corporate and agency experience that hail from various backgrounds. As such, First Impressions will never assign second-tier (or gasp! third tier!) support staff to any account.</p>\r\n<p style=\"box-sizing: inherit; margin: 0px 0px 28px; padding: 0px; color: #333333; font-family: \'Source Sans Pro\', sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-weight: bold;\">Pricing</span><br style=\"box-sizing: inherit;\" />Our prices are competitive and fair. There are no surprise bills. Any unexpected or additional expenses must be pre-approved by you. That&rsquo;s how we would like to be treated, and that is how our clients are treated.</p>\r\n<p style=\"box-sizing: inherit; margin: 0px 0px 28px; padding: 0px; color: #333333; font-family: \'Source Sans Pro\', sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-weight: bold;\">Meeting Deadlines</span><br style=\"box-sizing: inherit;\" />We have worked with select casinos and state agencies for many years. Their rule &ndash; if we miss a deadline, we&rsquo;re out. Period. They have some of the tightest turnarounds in the business &ndash; and we&rsquo;ve never missed a single one.</p>\r\n<p style=\"box-sizing: inherit; margin: 0px 0px 28px; padding: 0px; color: #333333; font-family: \'Source Sans Pro\', sans-serif; font-size: 16px;\">Work with us, and you&rsquo;ll work with seasoned professionals &ndash; vigilant of deadlines, and committed to exceeding client expectations.</p>', NULL),
